import React from "react";

function SignUp() {
  return (
    <div class="container border p-4 d-flex justify-content-center h-50 w-50">
      <div class="border border-primary w-50 p-3 border-radius-3">
        <div class="mb-3">
          <label for="exampleFormControlInput1" class="form-label">
            Email address
          </label>
          <input
            type="email"
            class="form-control"
            id="exampleFormControlInput1"
            placeholder="name@example.com"
          />
        </div>
      </div>
    </div>
  );
}

export default SignUp;
